import React from 'react';
import './Calendar.css';

const Calendar = () => {
  return (
    <div className="calendar">
      <h2>2024년 3월</h2>
      {/* 여기에 실제 캘린더 컴포넌트를 추가할 수 있습니다 */}
      <p>캘린더 컴포넌트 위치</p>
      <button className="next-button">NEXT</button>
    </div>
  );
};

export default Calendar;
